<script>
   
    const form = document.getElementById('loginForm');
    const emailInput = document.getElementById('email');
    const passwordInput = document.getElementById('password');
    const warning = document.getElementById('warning');

    // Handle form submission
    form.addEventListener('submit', function(event) {
        event.preventDefault(); // Prevents the form from submitting automatically
        
        // Check if both email and password are filled
        if (emailInput.value === '' || passwordInput.value === '') {
            warning.style.display = 'block'; // Show the warning
        } else {
            warning.style.display = 'none'; // Hide the warning
            // Redirect to the next page (this could be your actual destination URL)
            window.location.href = './homepage.html'; 
        }
    });
</script>
